import React, { Component } from 'react'
import NavDropdown from 'react-bootstrap/NavDropdown';
export class FilterDropDowns extends Component {

    constructor(props) {
        super(props);        
    }
    render() {
        // const title=props.details.title
        // this.navDropDown = params.fields.map((option)=>(
        //     <NavDropdown.Item >{option}</NavDropdown.Item>
        // ))
        return (
            <NavDropdown title={this.props.details.title} id="basic-nav-dropdown">
        {this.navDropDown}
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
      </NavDropdown>
        )
    }
}

export default FilterDropDowns;
